script: |
  super -f text -I q162.spq | sort > q162.out

inputs:
  - name: q162.spq
    data: |
      SELECT DISTINCT cor1.col0 AS col1 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) cor0 CROSS JOIN tab2 (FORMAT parquet), tab1 (FORMAT parquet), tab0 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q162.out
    data: |
      24
      35
      89
